def transform(sequence):
    sequence = list(sequence)
    ones = [i for i, x in enumerate(sequence) if x == "1"]
    for i in ones:
        sequence[i] = "1"
    for i in range(len(sequence)):
        if sequence[i] != "1":
            sequence[i] = "0"
    sequence = ''.join(sequence)
    return sequence
