def transform(sequence):
    count = 0
    result = []
    for digit in sequence:
        if digit == '0':
            count += 1
        else:
            zeros = count // 8
            result.append('0' * zeros + digit + '0' * (zeros + count % 8))
            count = 0
    return ''.join(result)
