    for i in range(len(sequence)):
        if sequence[i] == "8":
            result += "0"
        elif sequence[i] == "1":
            if sequence[:i].count("1") % 2 == 0:
                result += "1"
            else:
                result += "0"
        elif sequence[i] == "7":
            if sequence[:i].count("7") % 2 == 0:
                result += "7"
            else:
                result += "0"
        else:
            result += sequence[i]
    return result
